<!DOCTYPE html>
<html>
<head>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
<link rel="shortcut icon" href="<?php echo PT_GLOBAL_IMAGES_FOLDER.'favicon.png';?>">
<title>Responsive</title>
<style>

iframe {
        padding: 0;
        margin: 0;
        width: 100%;
        height: 80%;
        overflow-y: scroll;
        border: none
}
#mark-preview-mode,
html {
        padding: 0;
        margin: 0;
        width: 100%;
        height: 100%
}
#mark-preview-mode {
        font-family: Arial, sans-serif;
        color: #333;
        font-size: 14px;
        line-height: 1.42857
}
#mark-preview-archive-header {
        border: 0;
        border-bottom: 1px solid #ccc;
        box-shadow: 0 0 1px #ccc;
        background: #fff;
        width: 100%;
        display: table;
}
#mark-preview-archive-header .snb-para {
        margin: 2px 10px
}
#mark-preview-archive-header .gray_sib_logo {
        display: table-cell;
        vertical-align: top;
        padding: 10px 0 10px 10px;
        text-align: center;
        width: 50px;
}
#mark-preview-archive-header .gray_sib_logo img {
        position: relative;
}
#mark-preview-archive-header .previewInfo {
        display: table-cell;
        padding: 10px 10px 10px 0;
        vertical-align: top;
}
.mark-preview-container {
        padding: 20px 20px 0;
        height: 100%
}
.mark-preview-container .mark-preview-desktop {
        left: 50px;
        min-height: inherit;
        position: absolute;
        right: 450px;
        top: 90px;
        box-shadow: 0 4px 4px rgba(0, 0, 0, 0.2);
        height: 80%;
        background: #fff;
        transition: ease 0.5s
}
.mark-preview-container .mark-preview-desktop.resized {
        right: 700px !important;
        transition: ease 0.5s
}
.mark-preview-container .mark-preview-desktop iframe {
        height: 85%;
        background: #fff; /*if no any backbground color chosen by user for temaplate body then preview display on white page*/
}
.mark-preview-container .mark-preview-desktop h3 {
        font-weight: 100;
        position: relative;
        text-align: center
}
.mark-preview-container .mark-preview-desktop .browserHeader {
        padding: 12px 18px;
        border-left: 1px solid #ccc;
        border-right: 1px solid #ccc;
        position: relative;
        top: 0;
        background: #ffffff;
        background: -moz-linear-gradient(top, #ffffff 0%, #d3d3d3 100%);
        background: -webkit-gradient(linear, left top, left bottom, color-stop(0%, #ffffff), color-stop(100%, #d3d3d3));
        background: -webkit-linear-gradient(top, #ffffff 0%, #d3d3d3 100%);
        background: -o-linear-gradient(top, #ffffff 0%, #d3d3d3 100%);
        background: -ms-linear-gradient(top, #ffffff 0%, #d3d3d3 100%);
        background: linear-gradient(to bottom, #ffffff 0%, #d3d3d3 100%);
        filter: progid: DXImageTransform.Microsoft.gradient( startColorstr='#ffffff', endColorstr='#d3d3d3', GradientType=0)
}
.mark-preview-container .mark-preview-desktop .browserHeader .browserIcon {
        width: 8px;
        height: 8px;
        padding: 3px;
        border-radius: 50%;
        display: inline-block;
        margin: 0 2px;
        background: #ededed;
        background: -moz-radial-gradient(center, ellipse cover, #ededed 0%, #cccccc 100%);
        background: -webkit-gradient(radial, center center, 0px, center center, 100%, color-stop(0%, #ededed), color-stop(100%, #cccccc));
        background: -webkit-radial-gradient(center, ellipse cover, #ededed 0%, #cccccc 100%);
        background: -o-radial-gradient(center, ellipse cover, #ededed 0%, #cccccc 100%);
        background: -ms-radial-gradient(center, ellipse cover, #ededed 0%, #cccccc 100%);
        background: radial-gradient(ellipse at center, #ededed 0%, #cccccc 100%);
        filter: progid: DXImageTransform.Microsoft.gradient( startColorstr='#ededed', endColorstr='#cccccc', GradientType=1)
}
.mark-preview-container .mark-preview-mobile {
        background: #fff;
        border-radius: 25px;
        box-shadow: 0 4px 4px rgba(0, 0, 0, 0.2);
        display: block;
        height: 628px;
        margin-top: -314px;
        opacity: 1;
        position: absolute;
        right: 40px;
        top: 405px;
        width: 340px;
        z-index: 1;
        border: 1px solid #ccc;
        transition: ease 0.7s
}
.mark-preview-container .mark-preview-mobile h3 {
        font-weight: 100;
        position: relative;
        top: -60px;
        text-align: center
}
.mark-preview-container .mark-preview-mobile::after,
.mark-preview-container .mark-preview-mobile::before {
        background: #ccc;
        content: "";
        display: block;
        left: 50%;
        position: absolute
}
.mark-preview-container .mark-preview-mobile::after {
        border-radius: 5px;
        height: 10px;
        margin-left: -35px;
        top: 27px;
        width: 70px
}
.mark-preview-container .mark-preview-mobile::before {
        border-radius: 23px;
        bottom: 20px;
        height: 46px;
        margin-left: -23px;
        width: 46px
}
.mobile_screen_area {
        margin: 10px;
        height: 480px;
        width: 310px;
        margin-top: 60px;
        border: 5px solid #e2e2e2
}
.mobile_screen_area iframe {
        height: 100%
}
.mark-preview-container .mark-preview-mobile.landscapeMode {
        transform: rotate(-90deg);
        transition: ease 0.7s;
        right: 170px !important
}
.mark-preview-container .mark-preview-mobile.landscapeMode .mobile_screen_area {
        transform: rotate(90deg);
        width: 480px;
        height: 310px;
        margin: 140px -75px 10px
}
.mark-preview-rotate-btn {
        position: fixed;
        top: 730px;
        right: 165px;
        z-index: 9;
        font-family: "Open Sans";
        font-weight: 600;
        transition: ease 0.5s
}
.mark-preview-rotate-btn.resized {
        right: 300px !important;
        transition: ease 0.5s;
        top: 590px;
        transition: ease 0.5s
}
.mark-preview-rotate-btn .mark-preview-rotate-text {
        display: inline-block;
        color: #fff;
        font-size: 15px;
        font-weight: 600;
        margin: 0 10px;
        cursor: pointer
}
.mark-preview-logo {
        text-decoration: none;
        font-family: "Open Sans";
        font-weight: 600;
        cursor: default;
}
.mark-preview-logo img {
        float: left
}
.mark-preview-logo span {
        color: #fff;
        font-size: 16px;
        line-height: 36px;
        float: left;
        margin-left: 10px
}

/* When subject or other text too long or a lonoooooong single word */
.long-label-text {
        display: table;
}
.long-label-text span{
        display: table-cell;
}
.long-label-text span:first-child{
        white-space: nowrap;
}
.long-label-text span:last-child{
        padding-left: 5px;
}

/* preview content spacing only Rich and Copy/paste editor */
.preview-content-spacing{
        padding: 1% 1% 0px 7%;
        background: #fff;
        display: inline-block;
        height: 84%;
        width: 92%;
}
.preview-content-spacing iframe {
        height: 97% !important;
        background: #fff; /*if no any backbground color chosen by user for temaplate body then preview display on white page*/
}

